import './estilos_barra_lateral_izquierda.css';
import Botones from './botones';
import Campo_Central from '../Campo_Central/campo_central'


class BarraLateral extends React.Component{
  constructor(props){
    super(props);
    this.state = {
      showMe: false
    };
  }

  render(){
    return(
      <Campo_Central />
    );
  }
}


export default BarraLateral;
